import { createRouter, createWebHistory } from 'vue-router';
import Init_movie from '@/views/Init_movie.vue'; // Init_movie 컴포넌트 가져오기

// 라우터 경로 정의
const routes = [
    { path: '/', component: Init_movie }, // 기본 라우트로 Init_movie 지정
    // 다른 라우트 추가 가능
  ];

// 라우터 생성
const router = createRouter({
  history: createWebHistory(),
  routes,
});

export default router;
